import React from 'react';
import "./Admin.css";
import AddSession from './Add_Session/addSession'
import Navbar from './Navbar/Navbar'

const Admin = () => {

    return (
    <div>
      <Navbar/>
      <Route  path="/admin_add_session" render={() => <AddSession />}></Route>
    </div>
    )
}
export default Admin
